
-- if tables already exist, drop them

drop table Sale;
drop table Vehicle;
drop table CarModel;
drop table Brand;
drop table BodyStyle;
drop table Transmission;
drop table Engine;
drop table Dealer;
drop table Customer;

--create tables

create table Brand
(BrandId	numeric(3) not null,
 BrandName		varchar2(20) not null,
 Logo		varchar2(100),
 constraint Brand_pk primary key (BrandId));
 
create table BodyStyle
(StyleId        numeric(3) not null,
 StyleName		varchar2(20) not null,
 Passengers		numeric(2),
 constraint BodyStyle_pk primary key (StyleId));
 
create table Transmission
(TranId     numeric(3) not null,
 TranCode	varchar2(20),
 TranType	varchar2(10) not null,
 constraint Transmission_pk primary key (TranId));

create table Engine
(EngineId	numeric(3) not null,
 EngineName		varchar2(20),
 Cylinders	numeric(2) not null,
 Horsepower	numeric(3) not null,
 constraint Engine_pk primary key (EngineId));
 
create table Dealer
(DealerId	numeric(3) not null,
 DealerName		varchar2(20) not null,
 Address	varchar2(30),
 constraint Dealer_pk primary key (DealerId));
 
create table Customer
(CustomerId	numeric(4) not null,
 CustomerName	varchar2(25) not null,
 Address	varchar2(30),
 Phone		numeric(10) not null,
 Gender		varchar2(1),
 Income		numeric(7),
 constraint Customer_pk primary key (CustomerId));

create table CarModel
(ModelId	numeric(4) not null,
 BrandId	numeric(3) not null,
 Modelname	varchar2(20),
 BodyStyleId numeric(3) not null,
 constraint Model_pk primary key (ModelId),
 constraint Brand_fk foreign key (BrandId) REFERENCES Brand(BrandId),
 constraint BodyStyle_fk foreign key (BodyStyleId) REFERENCES BodyStyle(StyleId));

create table Vehicle
(VIN		varchar2(17) not null,
 ModelId	numeric(4) not null,
 DealerId	numeric(3) not null,
 EngineId	numeric(3) not null,
 TranId	numeric(3) not null,
 ProductionDate	date not null,
 Color		varchar2(10),
 constraint Vehicle_pk primary key (VIN),
 constraint Model_fk foreign key (ModelId) REFERENCES CarModel(ModelId),
 constraint Dealer_fk foreign key (DealerId) REFERENCES Dealer(DealerId),
 constraint Engine_fk foreign key (EngineId) REFERENCES Engine(EngineId),
 constraint Transmission_fk foreign key (TranId) REFERENCES Transmission(TranId));
 
create table Sale
(SaleId		numeric(4) not null,
 CustomerId	numeric(4) not null,
 DealerId	numeric(3) not null,
 VIN		varchar2(17) not null,
 SalePrice	numeric(6) not null,
 TagPrice	numeric(6) not null,
 SaleDate	date not null,
 constraint Sale_pk primary key (SaleId),
 constraint Customer_fk foreign key (CustomerId) REFERENCES Customer(CustomerId),
 constraint Vehicle_fk foreign key (VIN) REFERENCES Vehicle(VIN));

COMMIT;

